      description: '<p>PyData Munich is back with a couple of accessible data science tutorials!</p> <p>Schedule:<br/>- 18:30 Doors open<br/>- 19:00 Welcome to PyData Munich<br/>- 19:10 ‚ÄúKotlin üíï Data Science?‚Äù by Preslav Rachev, Senior Backend Engineer @ KI labs</p> <p>Software engineering and data science are two very different disciplines. Accommodating both in the same project is not trivial. The key to success relies on developers and data scientists having a middle ground where they could do their work productively, and without affecting the other side. Preslav\'s talk will try to revisit Kotlin as a language potentially suiting both sides. He will reflect on its advantages, and also the current roadblocks.</p> <p>Preslav is a Java/Python double agent with over 10 years of cumulative programming experience (both in industry and academia). He loves open-source software, making music, writing, and distance running.</p> <p>- 19:55 ‚ÄúIntroduction to Computer Vision‚Äù by Anton Kasyanov, Senior Machine Learning Engineer @ DataRobot</p> <p>The talk is aimed at the engineers who are curious about the area and have no prior experience with it. The main goal is to give the feel of what is it all about, what problems can be solved and some basic methods to do that.</p> <p>Anton works as a Senior Machine Learning Engineer in DataRobot for almost two years. Prior to that, he did a lot of backend and ML development using Python. He got his Computer Science Masters degree in RWTH Aachen (Germany) with a focus on Computer Vision.</p> <p>- 20:40 Job advertisements and networking with beer and pizza</p> <p>Many thanks to JetBrains (<a href="https://www.jetbrains.com/" class="linkified">https://www.jetbrains.com/</a>) for hosting and sponsoring this event!</p> <p>Hope to see you there!<br/>Connor &amp; Nithish</p> <p>P.S.: If you are interested in giving a talk or hosting an event, please contact one of the organizers!<br/>If you are looking for inspiration for a talk topic or want to request one, please check out the ever-growing lists of topics here: <a href="https://docs.google.com/document/d/1wrdv27B7UGRJelbk8EQdHmBZ8uuO0I4q2JlJrsiCGlI/edit?usp=sharing" class="linkified">https://docs.google.com/document/d/1wrdv27B7UGRJelbk8EQdHmBZ8uuO0I4q2JlJrsiCGlI/edit?usp=sharing</a></p> ',
