      link: 'https://www.meetup.com/DevOpsMunich/events/260427919/',
      description: '<p>DevOps: Ist das Kunst oder kann das weg? Eine knappe Dekade ist das Buzzword alt. In dieser Zeit ist das unscharfe Buzzword zu einem handfesten Thema geworden, das in etlichen Unternehmen sehr ernsthaft diskutiert wird und viel Sinn stiftet. Denn DevOps ist viel mehr als eine Gruppentherapie f√ºr frustrierte ITler mit neuen fancy Tools! Es betrifft mindestens den kompletten Arbeitsalltag. Ein Kultur-Refactoring, das es in sich hat und in besonders gro√üen Projekten besonders gro√üe technische und organisatorische Herausforderungen mit sich bringt.</p> <p>An welchen Stellen bei der Einf√ºhrung von DevOps-Methoden kann es zu Problemen kommen? Was sind die technischen Symptome? Bei welchen Problemen liegt die Ursache dagegen gar nicht in der Technik? Wie kann man sich der Probleml√∂sung ann√§hern? Dieser Vortrag bietet keine DevOps-Einf√ºhrung, sondern geht dorthin, wo es beim Einsatz in gro√üen Projekten, lange nach der vermeintlichen Einf√ºhrung, weh tut. Wir identifizieren potentielle Ursachen und diskutieren m√∂gliche Auswege.</p> <p>## Links</p> <p><a href="https://talks.arbe.io" class="linkified">https://talks.arbe.io</a> (Slides)<br/><a href="https://feedback.arbe.io" class="linkified">https://feedback.arbe.io</a> (Feedback)<br/><a href="https://twitter.com/arnisoph" class="linkified">https://twitter.com/arnisoph</a> (Twitter)</p> <p>## Vorkenntnisse</p> <p>Existierende praktische Erfahrung in der (agilen) Entwicklung und im Betrieb von skalierenden bzw. hochverf√ºgbaren Anwendungen helfen beim Verst√§ndnis der vorgetragenen Herausforderungen.</p> <p>## Lernziele</p> <p>Behandelt werden untechnische weiche Faktoren, die zu Misserfolgen im Tagesgesch√§ft f√ºhren, trotz und vielleicht wegen des Einsatzes von DevOps-Methoden.</p> <p>## Speaker Bio</p> <p>Arnold uses great technologies to move companies in Germany beyond #Neuland. As Senior Systems Engineer at inovex he\'s working on software-defined datacenter management, continuous integration/delivery, getting rid of the *legacy stuff* and is especially interested in system &amp; software architecture. At the end of the day he loves to get outside with his MTB.</p> ',
